import styled from "styled-components"

var TodoLiContainerNotDone = styled.li`
  background-color: #f0f0f0;
  border-radius: 10px;
  width: 300px;
  list-style: none;
  margin:5px;
  display: flex;
`;

var TodoLiContainerDone = styled.li`
  background-color: green;
  border-radius: 10px;
  width: 300px;
  list-style: none;
  margin:5px;
  display: flex;
`;



function Todo(props){
  return <TodoLiContainer>
    <TodoLiElement>{props.Due}</TodoLiElement>
    <TodoLiElement>{props.Task}</TodoLiElement>
    </TodoLiContainer>
}

export default Todo
